        <div class="absolute top-0 left-0 h-full w-2 bg-brand-blue"></div>
        
        <div class="p-20 box-border h-full flex flex-col relative z-10">
            <!-- Title with gradient text -->
            <div class="font-bold max-w-[70%] text-5xl leading-tight mb-10 line-clamp-3 bg-gradient-to-r from-brand-light-blue to-brand-blue bg-clip-text text-transparent drop-shadow-md">
                {{title}}
            </div>
            
            <!-- Description with subtle background -->
            <div class="font-medium max-w-[70%] text-3xl leading-snug mb-8 line-clamp-3 text-gray-100 p-5 rounded-lg shadow-lg border-l-4 border-brand-blue">
                {{tldr}}
            </div>
            
            <!-- Metadata section -->
            <div class="flex justify-between mt-auto pt-5">
                <div class="flex items-baseline bg-brand-gray/50 px-5 py-2 rounded-full shadow-md backdrop-blur-sm">
                    <div class="font-medium text-2xl mr-2 text-brand-blue">{{readingMinutes}}</div>
                    <div class="font-light text-lg">min read</div>
                </div>
                <div class="flex items-baseline bg-brand-gray/50 px-5 py-2 rounded-full shadow-md backdrop-blur-sm">
                    <div class="font-medium text-2xl mr-2 text-brand-blue">{{words}}</div>
                    <div class="font-light text-lg">words</div>
                </div>
                <div class="flex items-baseline bg-brand-gray/50 px-5 py-2 rounded-full shadow-md backdrop-blur-sm">
                    <div class="font-medium text-2xl mr-2 text-brand-blue">{{dateShort}}</div>
                    <div class="font-light text-lg">{{year}}</div>
                </div>
            </div>
        </div>
        
        <!-- Bottom decorative element -->
        <div class="absolute bottom-0 left-0 right-0 h-1 bg-gradient-to-r from-brand-darker via-brand-blue to-brand-light-blue"></div>
    </div>
</body>
